import React, { useState } from "react";
import { NavLink } from "react-router-dom";
import CatalogeFilterOptions from './CategoryFilterOptions'
function CatalogeFilter({ filtres, name }) {
   return (
      <NavLink class="filter__list-item">
         <div class="filter__item">
            <p>{name}</p>
            <CatalogeFilterOptions display="dfg" filtres={filtres} />
         </div>
      </NavLink>
   )
}

export default CatalogeFilter
